syntax:
{
		# (self, default-class-attribute, quals, literal-text)
		'date': (
			(lambda s, c, q, x: s.element(
				'time', s.text(x),
				('class', 'gregorian-calendar-date'),
				('datetime', x),
			))
		),
		'timestamp': (
			(lambda s, c, q, x: s.element(
				'time', s.text(x),
				('class', 'point'),
				('datetime', x),
			))
		),
	}
